(function($){$.extend({"redirect":function(url,data){var params=[];for(var key in data){var value=data[key];if(key!==null&&key!==undefined&&value!==null&&value!==undefined){params.push(encodeURIComponent(key)+"="+encodeURIComponent(value))}}if(params.length>0){url=url+"?"+params.join("&")}window.location.href=url}})})(jQuery);